=======

Hey, hey, it's the Monkees... being catapulted through one of American cinema's
most surreal sixties odysseys. The brainchild of Bob Rafelson, making his
directorial debut; his producing partner and Monkees cocreator Bert Schneider;
and Jack Nicholson, a coscreenwriter on the project, Head was the fanciful
beginning and ignominious end of the TV-bred supergroup's big-screen career. In
it, Micky Dolenz, Davy Jones, Michael Nesmith, and Peter Tork become trapped in
a kaleidoscopic satire that's movie homage, media send-up, concert movie, and
antiwar cry all at once. A constantly looping, self-referential spoof that was
ahead of its time, Head dodged commercial success on its release but has since
been reclaimed as one of the great cult objects of its era.

